import styled from "styled-components";

const StyleTodo = styled.div`
    border: 1px solid red;
    width: 800px;
    height: 1000px;
    margin: auto;
    margin-top: 150px;
`;
const Todo = () => {
    return (
        <StyleTodo>
            <input></input>
        </StyleTodo>
    );
};

export default Todo;
